// Home.js

import React, {Component} from 'react';

import '../assets/customStyles.css';
import Login from "./Login";
import Button from "react-bootstrap/Button";
import {Link} from "react-router-dom";
import Register from "./Register";
import Tab from "react-bootstrap/Tab";

class Home extends Component {
    state = {
        type: 'login'
    }

    render() {
        return (
            <div style={{
                flex: 1, minHeight: '100%', backgroundPosition: 'center',
                backgroundSize: 'cover',
            }}>


                <body>

                <Tabs id="controlled-tab-example" activeKey={this.state.type} onSelect={k => this.setState({type: k})}>
                    <Tab eventKey="login" title="Login">
                        <Login/>


                    </Tab>

                    <Tab eventKey="register" title="Registeration">
                        <Register/>
                    </Tab>
                </Tabs>
                <Button variant="primary">
                    Go to login
                    <Link to={'/Login'} className="nav-link">Go To Login</Link>
                </Button>

                </body>


            </div>
        );
    }
}

export default Home;
